import Link from "next/link";

const nav = () => {
    return (
        <nav className="d-flex justify-content-between">
            <Link href="/"><a href="">홈</a></Link>
            <Link href="/"><a href="">랭킹</a></Link>
            <Link href="/"><a href="">통계</a></Link>
            <Link href="/"><a href="">소식</a></Link>
        </nav>
    );
};

export default nav;
